//ロードが完成したら、セットアップして表示させる
async function modelinit() {

  const { human, humanData } = await loadBlender();
  //
  human.position.set(0, -9, 0)//任意に変更する
  human.scale.set(12, 12, 12)//任意に変更する 10 =>12
  human.name = "human"
  
  //== Human ==
  human.traverse((object) => { //モデルの構成要素をforEach的に走査
    if(object.isMesh) { //その構成要素がメッシュだったら

      object.material = new THREE.MeshBasicMaterial({
        color: 0x00CCCC,//cyan
      });
      object.frustumCulled = true;//近づいても消えない パフォーマンス注意
      object.geometry.attributes.position.needsUpdate = true;

      //面インデック番号の取り出し
      for(let i = 0; i < 1788; i++){ // 1710 1788
        humanindices[i] = object.geometry.index.array[i];
      }

      humanDates = object.geometry.attributes.position;

      /*
      object.material.onBeforeCompile = function ( shader ) {
        console.log(shader.vertexShader);
        console.log(shader.fragmentShader);
      }
      */      
    }
  });

  //postion座標の取り出し 994 926 1048 1042 2982 255*3=765 990 300
  for(let i = 0; i < 300; i++){
    let count = i * 3;
    humanVerticesX[i] = humanDates.array[count];
    humanVerticesY[i] = humanDates.array[count+1];
    humanVerticesZ[i] = humanDates.array[count+2];
  }
  
  modelset = true;//loop処理でanimationを実行させるフラグ

  //アニメーションデータの作成
  const animations = humanData.animations;
  if(animations && animations.length) {
    //Animation Mixerインスタンスを生成
    mixer = new THREE.AnimationMixer(human);
    //全てのAnimation Clipに対して
    for (let i = 0; i < animations.length; i++) {
        const clip = animations[i]
        //Animation Actionを生成
        action.push(mixer.clipAction(clip));
    }
    //アニメーションを再生
    activeAction = action[3];
    activeAction.play();
  }

  //
  humanObject = human;
  humanObjectClone = human.clone();
  humanObjectClone.name = "humanClone";
  //クローンはワイヤーフレーム
  humanObjectClone.traverse((object) => { //モデルの構成要素をforEach的に走査
    if(object.isMesh) { //その構成要素がメッシュだったら
      object.material = new THREE.MeshBasicMaterial({
        color: 0x22CCCC,
        wireframe : true,
      });
    }
  });

  //humanObjectClone
  scene.add(humanObject,humanObjectClone);

}

