function Loop() {
    //stats.begin();//stats計測
    const delta = clock.getDelta();//animation programs
    //const elapsedTime = clock.getElapsedTime();

    step++;

    //情報　デバック用
    //musicText.innerHTML = "<span>" + ` frame: ${renderer.info.render.frame}`+ ` drawCalls: ${renderer.info.render.calls}`+` triangles: ${renderer.info.render.triangles}`+` lines: ${renderer.info.render.lines}` +` points: ${renderer.info.render.points}`+` geometries: ${renderer.info.memory.geometries}`+` textures: ${renderer.info.memory.textures}` +"</span>";
    
    //sakura舞う
    if(wavemesh.visible){
      sakuratime += 0.8 * delta;
      if(sakuratime > 85)sakuratime=0.0;
      wavemesh.material.uniforms.uTime.value = sakuratime;
      wavemesh.material.uniformsNeedUpdate = true;
    }
    
    if(stagePartcleMesh.visible){
      stagePartcleMesh.material.uniforms.uTime.value += .6 * delta;
      stagePartcleMesh.material.uniformsNeedUpdate = true;
    }
    //
    //テキストをカメラにbillbordする
    plane.quaternion.copy(camera.quaternion);
    //テキストのポイントサイズ調整（カメラ距離）
    const a = new THREE.Vector3( 0, 0, 0 );
    plane.material.uniforms.cameraLength.value = a.distanceTo(camera.position);
    plane.material.uniformsNeedUpdate = true;

    //最後の強制演出///////////////////////////////////////////////////////////////////////////////////////
    if(cameraset.start){
      let cameraPositionX = cameraset.radius * Math.cos(camera.theta + cameraset.time );
      let cameraPositionZ = cameraset.radius * Math.sin(camera.theta + cameraset.time );
      camera.position.set(cameraPositionX, 0, cameraPositionZ);
      cameraset.time -= .070 * delta;
    }
    camera.lookAt(new THREE.Vector3(0, 0, 0));

    //==animation== 
    if ( mixer && modelset ) mixer.update( delta );
   
    //らせん階段
    if ( modelset && musicStart ){
      stageGroup.rotation.y += stage_rotate*delta;
      stageGroup.position.y += stage_speed*delta;
    }
    
    if( modelset && step % 6 == 0){

      let positions = new Float32Array(888);//296*3=888
      for(let i = 0; i < 296; i++ ){
        //これを採用中 
        positions[i * 3]     = humanVerticesX[i] +  ( Math.random() - 0.5) * 0.015; // 
        positions[i * 3 + 1] = humanVerticesY[i] + ( Math.random() - 0.5) * 0.015 + ( Math.random() - 0.5) * SongVocal * 0.20;
        positions[i * 3 + 2] = humanVerticesZ[i] + ( Math.random() - 0.5) * 0.015 + ( Math.random() - 0.5) * SongVocal * 0.20;	// 
      }
      //更新する
      humanObject.children[0].children[1].geometry.attributes.position.array = positions;
      humanObject.children[0].children[1].geometry.attributes.position.needsUpdate = true;
    }

    //MeshIndex = 460 初期値
    //キャラの面の制御
    if( modelset && step % 20 == 0){

      //if(MeshIndices > 0){

      let indices = new Uint32Array(1764); // 1710 1788 1764 1788 1764
      for(let i = 0; i < 588; i++){ // 1710/3=570 1788/3=596 1764/3=588
          indices[i*3] =  humanindices[i*3];
          indices[i*3+1] = humanindices[i*3+1];
          indices[i*3+2] = humanindices[i*3+2];
      }

      //空白配列を生成
      MeshIndexBox.forEach(function(index){
        indices[index*3] = 0;
        indices[index*3+1] = 0;
        indices[index*3+2] = 0;
      })
      //空白番号を更新する
      MeshIndexBox.forEach(function(value,index){
        MeshIndexBox[index] = value + 1;
        if( MeshIndexBox[index] > 589)MeshIndexBox[index] = 0;
      });

      //更新する      
      humanObject.children[0].children[1].geometry.index.array = indices;
      humanObject.children[0].children[1].geometry.index.needsUpdate = true;
      
      //}//END if
    }

    //boxの回転
    if(RotationObjectSet)BoxGroup.rotation.y += speed * delta;
 
    //線の装飾///////////////////////////////
    let numConnected = 0;
    let vertexpos = 0;
    const r_Harf = P_radius / 2.0;

    let particlePositions = pointGroup.geometry.attributes.position.array;
    for(let i = 0; i < particleNum; i++){
      particlePositions[i*3] += particleVelocity[i].x;
      particlePositions[i*3+1] += particleVelocity[i].y;
      particlePositions[i*3+2] += particleVelocity[i].z;

      if(particlePositions[i*3] < -r_Harf || particlePositions[i*3] > r_Harf){
        particleVelocity[i].x *= -1;
      }
      if(particlePositions[i*3+1] < -r_Harf || particlePositions[i*3+1] > r_Harf){
        particleVelocity[i].y *= -1;
      }
      if(particlePositions[i*3+2] < -r_Harf || particlePositions[i*3+2] > r_Harf){
        particleVelocity[i].z *= -1;
      }

      for(let j = i + 1; j < particleNum; j++){
        let dx = particlePositions[i*3]-particlePositions[j*3];
        let dy = particlePositions[i*3+1]-particlePositions[j*3+1];
        let dz = particlePositions[i*3+2]-particlePositions[j*3+2];
        let dist = Math.sqrt(dx*dx+dy*dy+dz*dz);

        if(dist < connectionDistance){
          let linePositions = lineMesh.geometry.attributes.position.array;
          linePositions[vertexpos++] = particlePositions[i*3];
          linePositions[vertexpos++] = particlePositions[i*3+1];
          linePositions[vertexpos++] = particlePositions[i*3+2];

          linePositions[vertexpos++] = particlePositions[j*3];
          linePositions[vertexpos++] = particlePositions[j*3+1];
          linePositions[vertexpos++] = particlePositions[j*3+2];
          numConnected++;
        }
      }
      lineMesh.geometry.setDrawRange(0,numConnected);
      lineMesh.geometry.attributes.position.needsUpdate = true;
      pointGroup.geometry.attributes.position.needsUpdate = true;
    }
   
    //////////////////////////////////////////////////////////////////////////////////////////
    //renderer.render(scene, camera) // render the scene using the camera
    effectComposer.render();

    requestAnimationFrame(Loop) //loop the render function
    //stats.end();//stats計測
}

Loop() //start rendering


