//// EndEffects Camera Motion

//曲の終了間際の強制演出_カメラの移動
function EndCamereMotion(){
  
  //console.log("EndCamereMotion_終了処理");
  
  //カメラの角度
  const a = new THREE.Vector3( 1, 0, 0 );
  const cvec2 = new THREE.Vector3(camera.position.x, 0, camera.position.z);
  if(camera.position.z > 0){
    camera.theta = a.angleTo( cvec2 ); 
  }else{
    camera.theta = a.angleTo( cvec2 )*(-1); 
  }

  //カメラの距離
  const g = new THREE.Vector3( 0, 0, 0 );
  const cvec3 = new THREE.Vector3(camera.position.x, camera.position.y, camera.position.z);
  cameraset.radius = g.distanceTo( cvec3 ); 
  
  //カメラ移動
  gsap.to(camera.position, 1.8,{
    x: cameraset.radius * Math.cos(camera.theta), 
    y: 0,
    z: cameraset.radius * Math.sin(camera.theta),
    ease: "power2.Out",
    id:"RotateCamera",
    onUpdate: function() {
    },
    onComplete:function(){
      cameraset.start = true;//カメラの回転スタート
    }
  });


}
