//// Dance Animation 

///// モーションアニメーションの切り替え関数
function fadeToAction( name, outDuration, inDuration ) {
  lastAction = activeAction;
  activeAction = action[ name ];

  if ( lastAction !== activeAction ) {
    lastAction.fadeOut( outDuration )
    activeAction
      .reset()
      .setEffectiveTimeScale( 1 )
      .setEffectiveWeight( 1 )
      .fadeIn( inDuration )
      .play();
  }
}

//終了のアニメーション処理
function EndAction( name, outDuration, inDuration ) {
  lastAction = activeAction;
  activeAction = action[ 2 ];
  activeAction.clampWhenFinished = true;

  if ( lastAction !== activeAction ) {
    lastAction.fadeOut( .6 )
  }
  activeAction.setLoop(THREE.LoopOnce).reset()
  .setEffectiveTimeScale( 1 )
  .setEffectiveWeight( 1 )
  .fadeIn( 1.0 )
  .play();

  mixer.addEventListener("finished", function (e) {//e.action
    lastAction = activeAction;
    activeAction = action[ name ];
    if ( lastAction !== activeAction ) {
      lastAction.fadeOut( outDuration )
    }
    activeAction
      .reset()
      .setEffectiveTimeScale( 1 )
      .setEffectiveWeight( 1 )
      .fadeIn( inDuration )
      .play();
  });
};

